public class BytecodeAnalysisTest {

    // Step 0: Generate custom interfaces forming a circular dependency chain
    private static void generateCustomInterfaces() throws IOException {
        String interface1 = "package temp;\npublic interface InterfaceA extends InterfaceB {\n}";
        String interface2 = "package temp;\npublic interface InterfaceB extends InterfaceA {\n}";
        String concreteClass = "package temp;\npublic class ConcreteClass implements InterfaceA {\n    public void method() {\n    }\n}";

        File tempDir = new File("temp");
        tempDir.mkdir();

        FileWriter writer1 = new FileWriter(new File(tempDir, "InterfaceA.java"));
        writer1.write(interface1);
        writer1.close();

        FileWriter writer2 = new FileWriter(new File(tempDir, "InterfaceB.java"));
        writer2.write(interface2);
        writer2.close();

        FileWriter writer3 = new FileWriter(new File(tempDir, "ConcreteClass.java"));
        writer3.write(concreteClass);
        writer3.close();
    }

    // Step 1: Compile the custom interface definitions into bytecode files
    private static List<JavaFileObject> compileInterfaces() throws IOException {
        generateCustomInterfaces();
        JavaCompiler compiler = ToolProvider.getSystemJavaCompiler();
        StandardJavaFileManager fileManager = compiler.getStandardFileManager(null, null, null);
        Iterable<? extends JavaFileObject> compilationUnits = fileManager.getJavaFileObjects(new File("temp"));
        StringWriter writer = new StringWriter();
        boolean success = compiler.getTask(writer, null, null, null, null, compilationUnits).call();
        if (!success) {
            throw new RuntimeException("Compilation failed: " + writer.toString());
        }
        return new ArrayList<>();
    }

    // Step 2: Create a temporary workspace containing the compiled bytecode
    private static void createTempWorkspace() {
        Repository repository = Repository.getInstance();
        repository.clear();
        File tempDir = new File("temp");
        for (File file : tempDir.listFiles()) {
            if (file.getName().endsWith(".class")) {
                try {
                    JavaClass javaClass = repository.findClass(file.getName().replace(".class", ""));
                    repository.storeClass(javaClass);
                } catch (Exception e) {
                    e.printStackTrace();
                }
            }
        }
    }

    // Step 3: Load the bytecode analysis system with the temporary workspace
    private static void loadBytecodeAnalysisSystem() {
        Repository repository = Repository.getInstance();
        repository.clear();
        repository.loadClass("temp.InterfaceA");
        repository.loadClass("temp.InterfaceB");
        repository.loadClass("temp.ConcreteClass");
    }

    // Step 4-7: Execute validation across fundamental types
    private static List<String> provideTestTypes() {
        List<String> types = new ArrayList<>();
        types.add("java.lang.String");
        types.add("java.util.List");
        types.add("java.time.LocalDateTime");
        types.add("java.util.stream.Stream");
